import React from "react";
import styles from "./Encore.module.scss";
import { Link } from "react-router-dom";

const Encore = () => (
  <div>
    <Link to="/confirm">
      <div className={styles.cancel}>Отменить</div>
    </Link>
  </div>
);

export default Encore;
